import Button from '@material-ui/core/Button'

function TimerButton(props){
    return (
        <div>
            // if the stopwatch is not yet running
            {(props.status === 0)? 
            <button onClick={props.start} className ="stopwatch-btn stopwatch-btn-gre"> Start</button> : ""
            }
            // if the stopwatch is running
            {(props.status === 1)? 
            <div>
            <button onClick={props.start} className ="stopwatch-btn stopwatch-btn-red"> Stop</button> 
            <button onClick={props.start} className ="stopwatch-btn stopwatch-btn-red"> Reset</button> </div>: ""
            }
        </div>
    );
}

export default TimerButton;
